# Method to collect user input
# Call the algorithm, process and display output
def process_input(sequence, k , L, t):

    final_str = ''
    output = max_occur_word(sequence, k, L, t)
    for val in output:
        final_str = final_str + val + ' '

    print(final_str.rstrip())


# Method to create all possible combinations of length k in given sequence of length L
# Make smaller chunks of words of length k, count the number of occurrences in the string and store it in dictionary

def max_occur_word(sequence, k, L, t):
    strings_max = []  # maximum count result

    # outer loop for selecting L letters. Loop count length of seq - L + 1
    for outer in range(len(sequence)-L+1):

        # select sub substring (Ex 0 - 75, 1-76 2-77 etc)
        outer_chunk = sequence[outer:outer+L]
        dict_count = {}

        # Loop for making smaller chunks of length k and store the count in dictionary
        for inner in range(len(outer_chunk)-k+1):

            # check the chunks of length k exists in dictionary already
            if outer_chunk[inner:inner+k] not in dict_count:
                dict_count[outer_chunk[inner:inner+k]] = 0              # If it doesnt exist, Create a key and initialize it to 0

            dict_count[outer_chunk[inner:inner+k]] += 1                 # else increase the count

        # Loop within the dictionary and find whether value exists previously
        for val in dict_count:
            if dict_count[val] >= t and val not in strings_max:
                strings_max.append(val)                             # Append result if it doesnt exist in the dictionary
    return strings_max

sequence = ""
k = 9
L = 589
t = 19
# Calling the main method
process_input(sequence, k , L, t)